import logo from './logo.svg';
import {Login_signup} from "./component/login_signup/login_signup";
import {Main} from "./component/Main/Main";
import 'bootstrap/dist/css/bootstrap.min.css'
import $ from 'jquery'
import 'bootstrap/dist/js/bootstrap.min.js'
import './lib/fonts/icomoon/style.css'
import './lib/global.css'
import Swal from "sweetalert2";
import {useState} from "react";
import {BrowserRouter as Router, Route, Routes, useNavigate} from "react-router-dom";
import {Header} from "./component/header/header";
import {Home} from "./component/Home/Home";
import {Category} from "./component/category/category";
import {Question} from "./component/question/question";
import {Game} from "./component/game/game";
import {Point} from "./component/point/point";
import {Profile} from "./component/profile/profile";
import {User} from "./component/user/user";
import {Footer} from "./component/footer/footer";
function App() {
  const [is_login, change_login] = useState(!!localStorage.getItem('login_token')); // login => true, signup => true
  const navigate =useNavigate()
  if(is_login){
    navigate('/')
  } else{
    navigate('/login')
  }
  return (
    <div className="App">
      <Router>

        <Routes>
          <Route path="/" element={<Home/>} />
          <Route path="/login" element={<Category/>} />

        </Routes>

      </Router>

    </div>
  );
}

export default App;
